// Landing.js
import React from "react";
import Greeting from "./Introduction/Greeting";

function Landing() {
  return (
    <div className="container">
      <div className="row">
        <div
          className="col aos-init aos-animate"
          id="col-left"
          data-aos="zoom-out-right"
        >
          <Greeting name="Bruno" />
          <Description
            text="I'm a junior developer and ICT student at the Hogeschool van Amsterdam.
            As a developer I take on several different projects creating mostly web applications."
          />
          <ActionButtons />
        </div>
        <div className="col aos-init aos-animate" data-aos="zoom-out-left">
          <LandingImage
            src="/images/illustration-landing.png"
            alt="illustration-landing"
          />
        </div>
      </div>
    </div>
  );
}

export default Landing;
